  return (
    <div>
      <Container maxWidth="lg">
        <Box sx={{ bgcolor: "#cfe8fc", height: "100vh", textAlign: "center" }}>
          <h1>hii</h1>
        </Box>
      </Container>
    </div>
  );
}
